import logo from './logo.svg';
import './App.css';

const url = 'https://api.wheretheiss.at/v1/satellites/25544';
//let Key = "df7cd00e-d2f8-4562-8758-20b9ed2e5a37";
//let Host = "public-api.tracker.gg";

function App() {

  setInterval(etsi, 2000);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
            <p id={"a"}></p>
      </header>
    </div>
  );
}

async function etsi() {

  const response = await fetch(url);
  const data = await response.json();
  //console.log(data);
  document.getElementById('a').textContent = data.latitude;

}


export default App;
